                  {console.log("entering form")}
            First Name: <input type="text" placeholder="First Name" required></input> <br/>
            Last Name: <input type="text" placeholder="Last Name" required></input> <br/>
            Email ID: <input type="email" placeholder="Email ID" required></input> <br/>
            Department: <select name="selectList" id="departdropdown">
                <option value="option 1">Option 1</option>
                <option value="option 2">Option 2</option>
