            Phone: <input type="tel" placeholder="Phone Number" required></input> <br/>
            DOB: <input type="date" placeholder="DOB" required></input> <br/>
                </form>
                <button>Save</button>
            </div>
            );
        }

    render(){
        return(
            <button onClick={this.addEmp('Entering Add Employee')}>Add Employee</button>
        );
    }
}
